import React from 'react';

const SkillSection = () => {
  const skills = [
    { name: 'HTML', percentage: '90%' },
    { name: 'CSS', percentage: '85%' },
    { name: 'JavaScript', percentage: '80%' },
  ];

  return (
    <section className="py-10">
      <h2 className="text-3xl font-bold text-center mb-6">Skills</h2>
      <div className="flex justify-center flex-wrap gap-10">
        {skills.map((skill, index) => (
          <div key={index} className="text-center">
            <div className="relative w-32 h-32 rounded-full bg-gray-700">
              <div className="absolute inset-0 rounded-full bg-black flex items-center justify-center">
                <span className="text-lg font-bold">{skill.percentage}</span>
              </div>
            </div>
            <p className="mt-4 font-semibold">{skill.name}</p>
          </div>
        ))}
      </div>
    </section>
  );
};

export default SkillSection;
